import React, {useState} from 'react';
import Button from 'react-bootstrap/Button';
import { withRouter } from "react-router";

const workoutsData = [
    {
        id: 1,
        name: "workout 1",
        muscleGroup: "glutes"
    },
    {
        id: 2,
        name: "workout 2",
        muscleGroup: "arms"
    },
    {
        id: 3,
        name: "workout 3",
        muscleGroup: "back"
    }
]
const WorkoutsView = (props) => {
    console.log(props);
    return (
        <div>
            <h1>all workouts page</h1>
            <table>
                <thead>
                    <tr>
                        <th>
                            name
                        </th>
                        <th>
                            Muscle group
                        </th>
                    </tr>
                </thead>
                <tbody>
                    {workoutsData.map((workout) => {
                        return (
                            <tr key={workout.id}>
                                <td><Button href={`/workouts/${workout.id}`}>{workout.name}</Button></td>
                                <td>{workout.muscleGroup}</td>
                            </tr>
                        )
                    })}
                </tbody>
            </table>
        </div>
    )
  }

export default withRouter(WorkoutsView);
